import blue from "./blue.jpeg";
import canyon from "./canyon.jpg";
import desert from "./desert.webp";
import grassland from "./grassland.jpeg";
import house from "./house.jpeg";
import jungle from "./jungle.jpeg";
import moon from "./moon.jpeg";
import mountains from "./mountains.jpeg";
import sunrise from "./sunrise.webp";
import trees from "./trees.webp";

const images = [
  blue,
  canyon,
  desert,
  grassland,
  house,
  jungle,
  moon,
  mountains,
  sunrise,
  trees,
];

export default images;
